import WhatsAppIcon from '@material-ui/icons/WhatsApp';
import './App.scss';

const Footer = () => (
    <footer>
    <ul>
    <p>Contact us:
        Tel: 54911
    </p>
    <FacebookIcon />
    <TwitterIcon />
    <YouTubeIcon />
